import React from 'react';
import TrailSearchResult from '../trailSearchResult/trailSearchResult';

const TrailSearchResultsList = (props) => {
   let results = props.results.map((trail, idx) => {
      return <TrailSearchResult 
         key={idx}
         name={trail.name}
         property={trail.prop}
         city={trail.city}
         state={trail.state}
      />
   })
   return (
      {results}
   )
}

export default TrailSearchResultsList;


let trailsSlice = this.state.list.slice(this.state.startIdx, this.state.startIdx+5)
         let trailsList = trailsSlice.map((trail, idx) => {
            return <TrailItem
               key={idx}
               trailID={trail.id}
               trailName={trail.name}
               trailProp={trail.prop}
               trailDistance={trail.distance}
               trailAltChange={trail.altitudeChange}
               trailAvgDiff={trail.avgDifficulty}
               trailAvgEnj={trail.avgEnjoyability}
               imageUrl={trail.image}
            />
         })
